import React from "react";
import "./Experience.css";
import ExperienceItem from "./ExperienceItem";

const Experience = () => {
  return (
    <>
      <section className="experience" id="experience">
        <h3 className="heading">
          <span> my</span> experience
        </h3>
        <ExperienceItem />
      </section>
    </>
  );
};

export default Experience;
